<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>gud-gdb-completions</strong> is a compiled Lisp function in `<code>gud.el</code>'.</br>
</br>
(gud-gdb-completions <u>CONTEXT</u> <u>COMMAND</u>)</br>
</br>
Completion table for GDB commands.</br>
<u>COMMAND</u> is the prefix for which we seek completion.</br>
<u>CONTEXT</u> is the text before <u>COMMAND</u> on the line.<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>.</small></body></html>
